El poema "Tal para cual" es de la poeta española Gloria Fuertes (1917-1998), una de las voces más importantes de la poesía española del siglo XX. Es característico de su estilo, que incluye humor, ironía y juegos de palabras, elementos todos presentes en este soneto.
